result:
query($id: ID!) {
  membership(id: $id) {
    title
    path
    belongsTo {
      totalCount
      edges {
        node {
          ... on Person {
             path
            content
            name
            rank
            memberships{
              id
              title
              path
            }
            bio
            excerpt
            linkedin
            websites
            countries
            cities
            private
            image
          }
        }
      }
    }
  }  

  allMembership(filter: {title: {in: ["foundation", "tech"]}}){
   edges{
    node{
      id
      title
      path
    }
  }
}

}
